import React from "react";
import * as S from "./Footer.styled";

const Footer = () => {
    return (
        <S.FooterContainer>
            <S.FooterText>
                &copy; {new Date().getFullYear()} Your Name. All rights
                reserved.
            </S.FooterText>
        </S.FooterContainer>
    );
};

export default Footer;
